(11, 'Atatürk Airport Transfer (Airport to Hotel)', 'We would be pleased to assist you with a pick up from the Airport to our Hotel.   Airport pick up transfer service has been arranged by our private car.  Transfer porter  will meet you in the Main Arrivals Hall directly after you pass through Customs Control at the Ataturk Airport,  he will be among the crowd of waiting people with holding a sign board that writes your name on it with our hotel name and logo. After you have met the butler, he will accompany you to transfer vehicle. Because of the Ataturk Airport vehicle entry proceduress; reaching to the vehicle may take up to 15 minutes   Please call us at 0212 5281343  in case of you cannot recognize him.', 'http://localhost/hotel/uploads/14/extras/L779.jpg', '{"unit":"\\u20ac 35","1":"15"}', 1, 1, 'Sun,Mon,Tue,Wed,Thu,Fri,Sat', '[{"label":"Hava Limani Sec","field_type":"dropdown","required":true,"field_options":{"options":[{"label":"Lutfen seciniz","checked":false},{"label":"Ataturk","checked":false},{"label":"Sabiha","checked":false}],"include_blank_option":false},"cid":"c19"},{"label":"Flight No","field_type":"text","required":true,"field_options":{"size":"small","description":"Lutfen ucus biligilerini yaziniz."},"cid":"c2"},{"label":"Ucus Saatiniz","field_type":"time","required":true,"field_options":{},"cid":"c6"}]', 1, 0, 14, 2),
(12, 'Atatürk Airport Transfer (Hotel to Airport)', 'We would be pleased to assist you with a pick up from the Airport to our Hotel.   Airport pick up transfer service has been arranged by our private car.  Transfer porter  will meet you in the Main Arrivals Hall directly after you pass through Customs Control at the Ataturk Airport,  he will be among the crowd of waiting people with holding a sign board that writes your name on it with our hotel name and logo. After you have met the butler, he will accompany you to transfer vehicle. Because of the Ataturk Airport vehicle entry proceduress; reaching to the vehicle may take up to 15 minutes   Please call us at 0212 5281343  in case of you cannot recognize him.\n', 'http://localhost/hotel/uploads/14/extras/L7791.jpg', '{"unit":"\\u20ac 35"}', 2, 0, 'Sun,Mon,Tue,Wed,Thu,Fri,Sat', '[]', 1, 0, 14, 2),
(13, 'Romance Setup', 'House Wine (35 cc) \nRoses\nRomantic Bed Arrangements \nChocolate Fondue with fresh fruits (please inform reception for service time)', 'http://localhost/hotel/uploads/14/extras/L993.jpg', '{"unit":"\\u20ac 29"}', 2, 0, 'Sun,Mon,Tue,Wed,Thu,Fri,Sat', '[{"label":"Untitled","field_type":"text","required":true,"field_options":{"size":"small"},"cid":"c2"}]', 1, 0, 14, 2),
(14, 'City Break Package', 'This package includes:\n\n*Free Ataturk Airport / Hotel / Ataturk Airport Transfers  \n*Istanbul Breeze Cocktail upon arrival \n*Complimentary selection of Turkish dried fruits and nuts & wine upon arrival    \n*Hot&Cold Buffet Breakfast or room service \n*One Night Dinner at Roof Top Olive Restaurant (fixed menu, drinks are extra)  \n*Free internet access  \n*Regular Half day City or Bosphorus Tour  ', 'http://localhost/hotel/uploads/14/extras/L911.jpg', '{"unit":"\\u20ac 289"}', 2, 0, 'Sun,Mon,Tue,Wed,Thu,Fri,Sat', '[]', 1, 0, 14, 2),
(15, 'Explore Istanbul Package', 'This package includes:\n\n*Free Ataturk Airport / Hotel / Ataturk Airport Transfers\n*Istanbul Breeze Cocktail upon arrival \n*Complimentary selection of Turkish dried fruits and nuts & wine upon arrival  \n*Hot&Cold Buffet Breakfast or room service  \n*One Night Dinner at Roof Top Olive Restaurant (fixed menu, drinks are extra)  \n*Free internet service\n*Regular Full Day City or Bosphorus Tour\n*Gala dinner with live Turkish entertainment (includes transportation)', 'http://localhost/hotel/uploads/14/extras/L912.jpg', '{"unit":"\\u20ac 789"}', 2, 0, 'Sun,Mon,Tue,Wed,Thu,Fri,Sat', '[]', 1, 0, 14, 2),
(16, 'Honeymoon Package', 'This package includes:\n\n*Free Ataturk Airport / Hotel / Ataturk Airport Transfers\n*Sultan’s Whisper Cocktail upon arrival \n*Complimentary selection of Turkish dried fruits and nuts & wine upon arrival\n*Bathrobe and Flowers in the room\n*Hot&Cold Buffet Breakfast or Room Service \n*One Night Dinner at Roof Top Olive Restaurant (fixed menu, drinks are extra) \n*Free internet Access \n*Regular Half Day City or Bosphorus Tour \n*Free Aromatherapy Massage for Two Persons  (please make your appointment at the reception)', 'http://localhost/hotel/uploads/14/extras/L1932.jpg', '{"unit":"479"}', 2, 0, 'Sun,Mon,Tue,Wed,Thu,Fri,Sat', '[]', 1, 0, 14, 2),
(17, 'Turkish Cooking  Class Package', 'This package includes:\n\n*Cooking class session of 2 hours with our executive chef \n*Selected Turkish Spices Gift Basket with Cook Book ', 'http://localhost/hotel/uploads/14/extras/L909.jpg', '{"unit":"\\u20ac 469"}', 2, 0, 'Sun,Mon,Tue,Wed,Thu,Fri,Sat', '[]', 1, 0, 14, 2),
(18, 'Jet Lag Recovery Package', '“To drive away the stress of traveling”\n\nThis package includes:\n\n*Istanbul Breeze Cocktail upon arrival  \n*Hot&Cold late Breakfast on room service  \n*Sultan Spa Jetlag Package  \n*One night dinner or lunch at roof top of  Terrace Olive Restaurant ( fixed menu, drinks are extra)', 'http://localhost/hotel/uploads/14/extras/L3877.jpg', '{"unit":"\\u20ac 400"}', 2, 0, 'Sun,Mon,Tue,Wed,Thu,Fri,Sat', '[]', 1, 0, 14, 2),
(19, 'Ottoman Romance Setup', '*2 fruite juice, table water and mineral water \n*Roses \n*Romantic Bed Arrangements \n*Chocolate Fondue with fresh fruits (please inform reception for service time)', 'http://localhost/hotel/uploads/14/extras/L5203.jpg', '{"unit":"\\u20ac 35"}', 2, 0, 'Sun,Mon,Tue,Wed,Thu,Fri,Sat', '[]', 1, 0, 14, 2),
(20, 'Sultan SPA Package', 'Includes 2 different massages; \n\n*Scrub and Foam Massage in Turkish Bath\n*Classic Massage \n*(Package total length is 90 Minutes)\n*Regular price €75. You save €10.\n*Please do not forget to get your coupon during check-in. Price is per person.', 'http://localhost/hotel/uploads/14/extras/M907.jpg', '{"unit":"\\u20ac 65"}', 2, 0, 'Sun,Mon,Tue,Wed,Thu,Fri,Sat', '[]', 1, 0, 14, 2),
(21, 'City Tour (Half Day)', '*Half day city or bosphorus tour. (When you book here, you save 5 Euros. Regular price at hotel is 35 euros). The price is per person per day.', 'http://localhost/hotel/uploads/14/extras/L3889.jpg', '{"unit":"\\u20ac 30"}', 2, 0, 'Sun,Mon,Tue,Wed,Thu,Fri,Sat', '[]', 1, 0, 14, 2),
(22, 'City Tour (Full Day)', 'Full day city or bosphorus tour. (When you book here, you save 5 Euros. Regular price at hotel is 70 euros). The price is per person per day.\n', 'http://localhost/hotel/uploads/14/extras/M3890.jpg', '{"unit":"\\u20ac 65"}', 2, 0, 'Sun,Mon,Tue,Wed,Thu,Fri,Sat', '[]', 1, 0, 14, 2),
(23, 'Late Check Out', 'Up to 18:00', '', '{"unit":"\\u20ac 50"}', 2, 0, 'Sun,Mon,Tue,Wed,Thu,Fri,Sat', '[]', 1, 0, 14, 2),
(24, 'Atatürk Airport Transfer (Airport to Hotel)', 'We would be pleased to assist you with a pick up from the Airport to our Hotel.   Airport pick up transfer service has been arranged by our private car. Transfer porter will meet you in the Main Arrivals Hall directly after you pass through Customs Control at the Ataturk Airport,  he will be among the crowd of waiting people with holding a sign board that writes your name on it with our hotel name and logo. After you have met the butler, he will accompany you to transfer vehicle. Because of the Ataturk Airport vehicle entry proceduress; reaching to vehicle may take up to 10-15 minutes. Our driver will be welcoming you with complimentary refreshments box that during your journey and then you can relax as the driver takes you on a scenic, half-hour drive to our Hotel. On your way home, a pre-ordered transfer will afford you the same stress-free ride back to the airport.\n\nPlease call us at 0212 5281343  in case of you cannot recognize him.', 'http://localhost/hotel/uploads/15/extras/L7832.jpg', '{"unit":"\\u20ac 40"}', 2, 0, 'Sun,Mon,Tue,Wed,Thu,Fri,Sat', '[]', 1, 0, 15, 2),
