ash at Check-in, the prices of Fully Flexible Rate apply! \n\nChildren Policy\n\nAll children under 2 years stay free of charge for cots.\n\nAll children under 7 years stay free of charge when staying with 2 adults/parents.\n\nMaximum capacity of babycots/extrabeds in a room is 1.\n\nAmenities & Services\n\nBaby-cot on request\nBath products and supplies\nBroadcasting\nDirect Dial Phone\nFire sprinklers\nFireproof doors\nHair-dryer\nIndividually Controlled Air Conditioner\nInstant coffee & tea maker\nIpod Dock / Alarm Clock Radio\nIron & Ironing Board\nLCD 32'''' high-definition TV with Satellite\nMini bar\nNon-smoking rooms available\nPhone in bathrooms\nQueen size bed\nSafe Box (suitable for laptops)\nSelection of pillows\nShower\nSlippers & bathrobe\nSmoke detectors\nSurround Sound System\nUSB DVD Player\nWi-Fi Internet Access (free of charge)\nWireless Internet Connection (free of charge)', 'en', 20, 15),
